contracts/GuessGame.sol.content:
// GuessGame.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@chainlink/contracts/src/v0.8/vrf/VRFConsumerBase.sol";

contract GuessGame is Ownable, VRFConsumerBase {
    using Strings for uint256;

    bytes32 internal keyHash;
    uint256 internal fee;
    uint256 private randomResult;
    uint256 private number;
    uint256 public betAmount = 0.00000001 ether;

    mapping(address => uint256) public playerPoints;

    event NumberGuessed(address player, uint256 guessedNumber, uint256 correctNumber, bool won);
    event PointsAwarded(address player, uint256 points);
    event NumberGenerated(uint256 number);

    constructor(
        address initialOwner,
        address vrfCoordinator,
        address linkToken,
        bytes32 _keyHash
    ) 
        Ownable(initialOwner)
        VRFConsumerBase(vrfCoordinator, linkToken) 
    {
        keyHash = _keyHash;
        fee = 0.1 * 10**18; // 0.1 LINK
        requestNewRandomNumber();
    }

    function requestNewRandomNumber() internal returns (bytes32) {
        require(LINK.balanceOf(address(this)) >= fee, "Not enough LINK");
        return requestRandomness(keyHash, fee);
    }

    function fulfillRandomness(bytes32 requestId, uint256 randomness) internal override {
        randomResult = randomness;
        number = (randomResult % 10) + 1;
        emit NumberGenerated(number);
    }

    function guess(uint256 _guess) external payable {
        require(msg.value == betAmount, "Incorrect bet amount");
        require(_guess > 0 && _guess <= 10, "Number must be between 1 and 10");

        playerPoints[msg.sender] += 5;
        bool won = (_guess == number);

        if (won) {
            playerPoints[msg.sender] += 15;
            requestNewRandomNumber();
        }

        emit NumberGuessed(msg.sender, _guess, number, won);
        emit PointsAwarded(msg.sender, playerPoints[msg.sender]);
    }

    function getPoints(address _player) external view returns (uint256) {
        return playerPoints[_player];
    }

    function withdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}

